import React, { useEffect, useRef, useState } from 'react';

function TranscriptPanel({ transcript, active, callStartTime, callSummary }) {
  const transcriptEndRef = useRef(null);
  const [elapsedTime, setElapsedTime] = useState(0);

  useEffect(() => {
    transcriptEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [transcript]);

  useEffect(() => {
    let interval;
    if (active && callStartTime) {
      interval = setInterval(() => {
        const elapsed = Math.floor((Date.now() - callStartTime) / 1000);
        setElapsedTime(elapsed);
      }, 1000);
    } else if (!active) {
      // Keep the final time when call ends
    }
    return () => clearInterval(interval);
  }, [active, callStartTime]);

  const formatTime = (seconds) => {
    const mins = Math.floor(seconds / 60);
    const secs = seconds % 60;
    return `${mins}:${secs.toString().padStart(2, '0')}`;
  };

  return (
    <div className="panel transcript-panel">
      <div className="transcript-header">
        <h3>
          üìù Live Transcript
          {active && <span className="live-indicator">‚óè LIVE</span>}
        </h3>
        {callStartTime && (
          <div className="call-timer">
            <span className="timer-icon">‚è±Ô∏è</span>
            <span className="timer-value">{formatTime(elapsedTime)}</span>
          </div>
        )}
      </div>

      <div className="transcript-container">
        {transcript.length === 0 ? (
          <p className="no-data">Waiting for call to start...</p>
        ) : (
          <>
            {transcript.map((line, idx) => (
              <div key={idx} className={`transcript-line ${line.speaker.toLowerCase()}`}>
                <span className="timestamp">[{line.timestamp}]</span>
                <span className="speaker">{line.speaker}:</span>
                <span className="text">{line.text}</span>
              </div>
            ))}
            <div ref={transcriptEndRef} />
          </>
        )}
      </div>

      {/* Call Summary when call ends */}
      {callSummary && !active && (
        <div className="call-summary-box">
          <h4>üìã Call Summary</h4>
          <div className="summary-content">
            <div className="summary-item">
              <span className="summary-label">Duration:</span>
              <span className="summary-value">{formatTime(elapsedTime)}</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">Issue:</span>
              <span className="summary-value">{callSummary.issue_category || 'N/A'}</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">Resolution:</span>
              <span className="summary-value">{callSummary.resolution || 'Pending'}</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">Sentiment:</span>
              <span className={`summary-value sentiment-${callSummary.final_sentiment?.toLowerCase()}`}>
                {callSummary.final_sentiment || 'N/A'}
              </span>
            </div>
            {callSummary.next_steps && (
              <div className="summary-item">
                <span className="summary-label">Next Steps:</span>
                <span className="summary-value">{callSummary.next_steps}</span>
              </div>
            )}
          </div>
        </div>
      )}
    </div>
  );
}

export default TranscriptPanel;
